import React, { useEffect, useRef } from 'react';
import * as d3 from 'd3';
import data from './data.json';
import {tree} from "https://cdn.skypack.dev/d3-hierarchy@3";

const Tree = () => {
  const svgRef = useRef(null);

  d3.tree();

  tree(data);

  return <svg ref={svgRef} />;
};

export default Tree;
